import React from "react";
import './index.scss';

const Header = () => {
    return (
        <div>
            <header className="header">
                <img className="icon"
                    src="https://png.pngtree.com/png-clipart/20190515/original/pngtree-gladiator-logo-png-image_3629358.jpg"
                    alt=""
                />
            </header>
            <nav className="nav">
                <div>Profile</div>
            </nav>
            <div className="content">Main content</div>
        </div>
    );
};

export default Header;
